def main():
    """
    Main function
    """
    num_costumes = int(input())
    costumes = []
    for _ in range(num_costumes):
        costumes.append(input())
    costume_set = list(set(costumes))
    costume_counts = [costumes.count(costume) for costume in costume_set].sort()
    max_count = max(costume_counts)
    winners = [costume for costume, count in zip(costume_set, costume_counts) if count == max_count]
    print('\n'.join(sorted(winners)))

if __name__ == "__main__":
    main()


def main():
    """
    This is the main function
    """
    num_inputs = int(input("Enter number of inputs: "))
    costume_dict = {}
    for i in range(num_inputs):
        costume = input("Enter costume: ")
        if costume in costume_dict:
            costume_dict[costume] += 1
        else:
            costume_dict[costume] = 1
    max_costumes = max(costume_dict.values())
    for costume in costume_dict:
        if costume_dict[costume] == max_costumes:
            print(costume)

if __name__ == "__main__":
    main()

